import React from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Calendar, User, Clock, CheckCircle2, AlertCircle, Edit, Trash } from 'lucide-react';
import { format, differenceInHours } from 'date-fns';
import { es } from 'date-fns/locale';

const ReservationList = ({ reservations, onEdit, onDelete, isAdmin = false, userName = '' }) => {
  const filteredReservations = isAdmin ? reservations : reservations.filter(r => r.user === userName);

  if (filteredReservations.length === 0) {
    return (
      <motion.div
        className="bg-white/80 backdrop-blur-xl border border-gray-200/50 rounded-3xl p-12 text-center shadow-xl"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
      >
        <Calendar className="w-16 h-16 text-gray-400 mx-auto mb-4" />
        <h3 className="text-xl font-bold text-gray-800 mb-2">Sin Reservas</h3>
        <p className="text-gray-500">No hay reservas {isAdmin ? 'disponibles' : 'tuyas'} aún. ¡Crea una!</p>
      </motion.div>
    );
  }

  return (
    <div className="space-y-4">
      <AnimatePresence>
        {filteredReservations.map((reservation, index) => (
          <motion.div
            key={reservation.id}
            className="bg-white/90 backdrop-blur-sm border border-gray-200/50 rounded-2xl p-6 shadow-sm hover:shadow-md transition-all duration-300"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            transition={{ duration: 0.3, delay: index * 0.05 }}
          >
            <div className="flex flex-col md:flex-row md:items-center md:justify-between gap-4">
              <div className="flex-1">
                <div className="flex items-start gap-3 mb-2">
                  <div className={`p-2 rounded-xl ${
                    reservation.status === 'confirmed' ? 'bg-green-100' : 'bg-yellow-100'
                  }`}>
                    {reservation.status === 'confirmed' ? (
                      <CheckCircle2 className="w-5 h-5 text-green-600" />
                    ) : (
                      <AlertCircle className="w-5 h-5 text-yellow-600" />
                    )}
                  </div>
                  <div>
                    <h3 className="text-lg font-bold text-gray-800">{reservation.title}</h3>
                    <p className="text-sm text-gray-600 flex items-center gap-1">
                      <User className="w-4 h-4" /> {reservation.user}
                    </p>
                  </div>
                </div>
                <p className="text-gray-700 mb-3">{reservation.description}</p>
                <div className="flex flex-wrap gap-4 text-sm text-gray-500">
                  <span className="flex items-center gap-1">
                    <Calendar className="w-4 h-4" /> {reservation.friendlyTime || `${format(reservation.startTime, 'PPPp', { locale: es })} - ${format(reservation.endTime, 'p', { locale: es })}`}
                  </span>
                  <span className="flex items-center gap-1">
                    {reservation.room.nombre} (Capacidad: {reservation.room.capacidad})
                  </span>
                </div>
              </div>
              <div className="flex items-center gap-2 self-start md:self-auto">
                <motion.button
                  onClick={() => onEdit(reservation)}
                  className="p-2 text-blue-600 hover:bg-blue-50 rounded-lg transition-colors"
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.9 }}
                >
                  <Edit className="w-5 h-5" />
                </motion.button>
                <motion.button
                  onClick={() => onDelete(reservation.id)}
                  className="p-2 text-red-600 hover:bg-red-50 rounded-lg transition-colors"
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.9 }}
                >
                  <Trash className="w-5 h-5" />
                </motion.button>
                {reservation.status === 'pending' && (
                  <span className="px-3 py-1 bg-yellow-100 text-yellow-800 rounded-full text-xs font-medium">
                    Pendiente
                  </span>
                )}
              </div>
            </div>
          </motion.div>
        ))}
      </AnimatePresence>
    </div>
  );
};

export default ReservationList;
